import Votacao from './components/Votacao';
import Cidade from './components/Cidade';

function App() {
  return (
    <div className="App">
      <Votacao>
        <Cidade nome="Quixadá"/>
        <Cidade nome="Fortaleza"/>
        <Cidade nome="Boa"/>
      </Votacao>
    </div>
  );
}

export default App;
